import {combineReducers} from '@reduxjs/toolkit';
import {createStore} from 'redux'
import { userRedusers, usersReducers } from './reducer';


const initialState ={
users: [
  {
    id: 'sdfsdf',
    name: 'Ivan',
    surname: 'Ivanov',
    e_mail: 'IvanIvanov@mail.ru'
  }
]
}


export const store = createStore(
  combineReducers({userRedusers, usersReducers}),
)

store.dispatch({
  type: 'ADD_USER',
  payload: {
    id: '323uytgfs5'
  }
})

console.log(store.getState().userRedusers)
